import React from "react";

const Nav = () => (
  <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
    <a className="navbar-brand" href="/">
      NYT React 
    </a>
    <a>Search</a>
    <a>Saved Articles</a>
  </nav>
);

export default Nav;
